DECLARE
   cursor cur is
select c.id,c.function_code from functions c ORDER BY c.id;
BEGIN
FOR c1 in cur
   LOOP
    update state_transaction_matrix a set a.matrix_code = (c1.function_code ||'_'||a.action) where a.function_id=c1.id;
   END LOOP;
END;
